// src/components/EventDetails.js
import React from 'react';

const EventDetails = ({ details }) => {
  return (
    <div id="event-details" style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '10px', backgroundColor: '#ffffff', height: '300px', overflowY: 'auto' }}>
      {details}
    </div>
  );
};

export default EventDetails;
